          fill={darkMode ? "#0c0c0c" : "#e0f7fa"}
          fillOpacity="1"
          d="
            M0,160 C320,320 1120,0 1440,160 
            L1440,320 L0,320 Z
          "
        />
      </svg>
    </div>
  );
}
